import React from "react";
import "./Menu.css";

function Menu() {
  return (
    <div class="menu">
      <h6 className="FMH6">Menus</h6>
      <a href="#about">About</a>
      <a href="#">Home</a>
      <a href="#services">Service</a>
    </div>
  );
}

export default Menu;
